import Statistics from './Statistics'

export default 
function StatisticsList ({ items }){
return(
    <ul class="stat-list">
        {items.map(item => 
        <li>
            <Statistics 
      key={item.id}
      title={item.label} 
      stats={item.percentage} />
        </li>)}
    </ul>
)
}
